}
if (dbUserName.equals(requestUserName)) {
    String dbPhoneNumber = scimUserFromDb.getPhoneNumber();
    String requestPhoneNumber = scimUserFromRequest.getPhoneNumber();
    if (dbPhoneNumber.equals(requestPhoneNumber)) {
        String dbFamilyName = scimUserFromDb.getFamilyName();
        String requestFamilyName = scimUserFromRequest.getFamilyName();
        if (dbFamilyName.equals(requestFamilyName)) {
            String dbGivenName = scimUserFromDb.getGivenName();
            String requestGivenName = scimUserFromRequest.getGivenName();
            if (dbGivenName.equals(requestGivenName)) {
                String dbDisplayName = scimUserFromDb.getDisplayName();
                String requestDisplayName = scimUserFromRequest.getDisplayName();
                if (dbDisplayName.equals(requestDisplayName)) {
                    String dbPassword = scimUserFromDb.getPassword();
                    String requestPassword = scimUserFromRequest.getPassword();
                    if (dbPassword.equals(requestPassword)) {
                        return true;
                    }else{
                        return false;
                    }

                }else{
                    return false;
                }

            }else{
                return false;
            }

        }else{
            return false;
        }

    }else{
        return false;
    }

